import math

def find_divisors(num):
    divisors = []
    for i in range(3, int(math.sqrt(num)) + 1):
        if num % i == 0:
            divisors.append(i)
            quotient = num // i
            if quotient != i:
                divisors.append(quotient)
    return sorted(divisors)

